def fix_green_letter(character, position):

    global required_words
    # print('\nBefore Filtering Green Letter\n',required_words)

    print("Keeping Character \'"+character+"\' at position "+str(position+1))

    new_required_words = []

    for i in required_words:
        if(i[position]==character):
            # print(i[position],character,end='\n')
            new_required_words.append(i)



    # print('\nNew Required Words Green Letter\n',new_required_words)
    required_words = new_required_words[:]
    print('\nAfter Filtering Green Letter\n',required_words)

    return

